import React, {Component, Fragment} from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import { db } from '../stitch/database';
import { searchToCard } from './PersonFound';
import { Home } from './App';
import { Search } from './Search';

export default class FinishSearch extends Component {
  constructor(props) {
    super(props);
    this.state = {...this.props.location.state};
  }
  render() {
    return(
        <div>
          <h2>Search Finished!</h2>
          <p></p>
            {this.state && searchToCard(this.state)}
          <p></p>
          <h3>Would you like to search again?</h3>
          <p></p>
          <Link to={{pathname: '/search', state: this.state}}><button>Yes</button></Link>
          <Link to='/'><button>No</button></Link>
          <div>
          </div>
        </div>
    );
  }
}
